import React from "react";
import { Card, PageHeader, Button} from 'antd';
import { Steps } from 'antd';

// components

const { Step } = Steps;

export default function NewProject() {
    const stepChange = (e) => {
        console.log(e)
    }
    return (
        <>
            <div style={{minHeight: "80vh"}} className="flex justify-center items-center bg-white">
                <div style={{width: "900px"}}>
                <PageHeader
                    ghost={false}
                    onBack={() => window.history.back()}
                    title=""
                    subTitle="Select a project to continue"
                    extra={[
                        <Button
                            key="1"
                            type="primary"
                        >
                            Next
                        </Button>,
                    ]}
                    >
                </PageHeader>
                    <Card>
                        <Steps progressDot current={0} onChange={(e) => stepChange(e)}>
                            <Step title="Job Info" />
                            <Step title="Well Info" />
                            <Step title="Well Volume" />
                            <Step title="Client Info" />
                            <Step title="Crew Info" />
                            <Step title="Equipment" />
                        </Steps>
                    </Card>
                </div>
            </div>
        </>
    );
}
